import Chart from "react-google-charts";
import { GlobalThemes } from "../../ThemeManager";

const EnterpriseTheme = ({}: {}) => {
  return (
    <div className={"contentContainer " + GlobalThemes.Enterprise}>
      <div className="pageLabel">{GlobalThemes.Enterprise.toString()}</div>
      <div className={"card"}>
        <Chart
          chartType="PieChart"
          loader={<div>Loading Chart</div>}
          data={[
            ["Expense", "Cost"],
            ["Travel", 11],
            ["Advertisement", 2],
            ["Client-Expenses", 2],
            ["Out-sourcing", 2],
            ["Logistics", 7],
          ]}
          options={{
            title: "Expenses",
            legend: "none",
            pieSliceText: "label",
            slices: {
              4: { offset: 0.2 },
              12: { offset: 0.3 },
              14: { offset: 0.4 },
              15: { offset: 0.5 },
            },
          }}
          rootProps={{ "data-testid": "1" }}
        />
      </div>
      <div className="card">
        <Chart
          chartType="LineChart"
          loader={<div>Loading Chart</div>}
          data={[
            ["x", "dogs", "cats"],
            [0, 0, 0],
            [1, 10, 5],
            [2, 23, 15],
            [3, 17, 9],
            [4, 18, 10],
            [5, 9, 5],
            [6, 11, 3],
            [7, 27, 19],
          ]}
          options={{
            hAxis: {
              title: "Time",
            },
            vAxis: {
              title: "Popularity",
            },
            series: {
              1: { curveType: "function" },
            },
          }}
          rootProps={{ "data-testid": "2" }}
        />
      </div>
    </div>
  );
};
export default EnterpriseTheme;
